import React from 'react'
import crossBtn from '../assets/crossBtn.png'

const Notification = (props) => {
  return (
    <div className={`notify ${props.msg}`}>
        <h6 className={props.msgType}>{props.msg}</h6>
        <img src={crossBtn} alt="cross notification" />
    </div>
  )
}

export default Notification
